        stepStart         = null;
        stepSize          = null;
        eventsStates      = new ArrayList<FieldEventState<T>>();
        statesInitialized = false;
        evaluations       = IntegerSequence.Incrementor.create().withMaximalCount(Integer.MAX_VALUE);
